import Sidebar from "../../components/sidebar/Sidebar";
import SinglePost from "../../components/singlePost/SinglePost";
import Header from "../../components/header/Header";


export default function Single() {
  return (
    <div className="single">
      <Header />

      <SinglePost/>
      <Sidebar />
    </div>
  );
}
